Год выпуска: 1984;
Произведён в СССР;
Собран в Новофедоровке, Крым;
Обкатан в морской пехоте;
Регистрация: Московская;
Цвет: Бронзовый;
Высота: 197 см;
Масса: 87 кг;
Фары: Разноцветные
(правая - бирюзовая, левая - серо-коричневая);
Полноприводный;
Крайне неприхотлив в эксплуатации;
Гаражное хранение, возможно краткосрочное на улице под тентом;
Каркас: Карбоновый, облегчённый, не битый, антикоррозийная обработка проведена;
Имеется царапина на лобовом стекле справа, обзору не мешает;
Полируется после каждой мойки;
Тип топлива: Только высокооктановое
(отборное молоко 6%, ряженка 4%, кефир 1%, натуральные соки, минеральная вода), применение качественного низкооктанового горючего (портвейн, пиво, водка, коньяк, спирт, ром, виски, вино и пр.) допускается крайне редко;
Расход топлива: Максимальный
(в дорогу необходимо два подвесных бака либо дозаправка на ходу);
Система смазки: Сало с перцем, луком, чёрным хлебом и чесноком;
КПП: Механическая с 19-ти см рычагом переключения передач (не западает, проблем не было и не будет, работает исправно), ЗАДНЕЙ СКОРОСТИ НЕТ!!!
На крутых поворотах иногда заносит (При полном баке низкооктанового горючего);
Крыша: На месте, люк тоже, не сносит даже на максимальной скорости при полном баке низкооктанового топлива;
БЕЗ БАШНИ!!!
Тормоза: ABS и EBS, РУЧНИК ОТСУТСТВУЕТ!!!
Суперсовременная титановая защита картера;
Бронирование: 30-ти сантиметровая титановая лобовая броня, плавно переходящая в затылок;
Педали жесткие, не проваливаются;
Руль легкий, оснащён ГУР, но при неаккуратном обращении может клинить и совсем отказывать в управлении;
Салон: Кожа;
Заводится с пол-оборота. Без проблем даже утром и в мороз. Работает как часы;
Полностью готов к зимней эксплуатации;
Эксплуатировался на всех широтах РФ, от Заполярья, до Северного Кавказа;
Идеальное состояние. Всё новое. Предпродажная подготовка проведена.
Обслуживание проводится регулярно, в сервисном центре у производителя;
ТО пройден до 2013 г.;
Номера на двигателе и кузове не перебивались;
Не требует установки противоугонной системы;
Тест-драйв обговаривается заранее;
Посредникам НЕ БЕСПОКОИТЬ!!!
Парковку на платной стоянке НЕ ПРЕДЛАГАТЬ!!!
Юридически полностью свободен и чист.

